statements.sql:
SELECT (
SELECT SUM(amount)
FROM earnings
WHERE space_id = 1 AND YEAR(happened_on) = '2019' AND MONTH(happened_on) = '07'
) - (
SELECT SUM(amount)
FROM spendings
WHERE space_id = 1 AND YEAR(happened_on) = '2019' AND MONTH(happened_on) = '07'
) AS balance;

